      }

        background-color: #333333;
      }
     
      #container {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
        width: 100vw;
      }
     
      #table {
        background-color: white;
        border-collapse: collapse;
        text-align: center;
        margin: auto;
        width: 80%;
      }
     
      #table tr:first-child {
        background-color: #333333;
      }
     
    #table tr:nth-child(2) {
  background-color: #333333;
  color: white;
  height: 500px;
}

     
      #table tr:last-child {
        background-color: #800080;
        color: white;
      }
     
      #table td {
        padding: 10px;
      }
      table {
  table-layout: fixed;
}
